import React from 'react';
import { Link } from 'react-router-dom';
import { TopicBox } from '../components/TopicBox';

export default function Home() {	
  return (
    <div>
      <h1>Smart Care</h1>
      <Link to="/Aboutus">Aboutus</Link>
      <div>
        <button onClick={() => alert('Emergency 011-32144578')}>Button 1</button>
        <button onClick={() => alert('Make a appoinment')}>Button 2</button>
      </div>
      <div>
        <TopicBox />
      </div>
    </div>
  );
}
